@use "sass:math";
@import url('https://fonts.googleapis.com/css?family=Playfair+Display:900');

* {
  margin: 0;
  padding: 0;
}

li {
  list-style-type: none;
}

a {
  text-decoration: none;
}

body {
  background-color: #E6E2DD;
  overflow-x: hidden;
}

.fixed {


  margin-top: 0px;
}

.header {
  /* margin-top: 20px; */
  border-top: 1px solid #707070;
  border-bottom: 1px solid #707070;
  width: 100%;
  background-color: #e6ddd4;
  z-index: 10;
  top: 20px;
  position: fixed;
  transition: 0.3s;

  .header_lnb {
    width: 1280px;
    margin: 0 auto;
    display: flex;
    justify-content: space-around;
    height: 84px;


    .header_time {
      width: 300px;
      font-size: 18px;
      margin-top: 30px;
    }

    .header_center {

      .lnb_icon {
        width: 84px;
        height: 84px;
        animation: rotate_image 8s linear infinite;
        transform-origin: 50% 50%;
      }

      @keyframes rotate_image {
        100% {
          transform: rotate(360deg);
        }
      }

    }

    .header_gnb {
      display: flex;
      width: 300px;
      justify-content: space-between;
      font-size: 18px;
      margin-top: 30px;
      /* cursor: pointer; */
      transition: 0.3s;
      font-weight: bold;

      .intro {
        color: red;
      }

      .profile {}

      .skill {}

      .progect {}

      .contact {}
    }

/*     .header_gnb div:hover {
      color: red;
    } */

  }
}



.intro_Page {
  width: 1280px;
  margin: 0 auto;
  margin-top: 120px;

  /*   h2 {
    margin-top: 20px;
    font-size: 130px;
    text-align: center;
  } */

  .intro_Page_text_box {
    width: 1280px;
    height: 220px;
    display: flex;
    justify-content: center;
    align-items: center;

    .intro_Page_text {
      fill: #35322a;
      filter: url('#money');
      font-family: 'Playfair Display', 'Georgia', serif;
      font-size: 125px;
      font-weight: 900;
    }
  }




  .intro_box{
    position: relative;
    margin-top: 20px;
    
    height: auto;
    margin-left: 90px;

    .intro_img {
      width: 1100px;
    }

    .intro_video_replay_box{
      position: absolute;
      right: 0;
      bottom: 0; 

      .intro_video_replay_text{
        position: absolute;
        width: 262px;
        bottom: 285px;
        right: 120px;
        font-size: 23px;
        font-weight: bold;

        .smile_ico{
          position: absolute;
          width: 30px;
          height: 30px;
          bottom: -1px; right: 82px;
         /*  margin-top: -20px; */
        }
      }

      .intro_video_replay_img{
        position: absolute;
        width: 280px;
        height: auto;
        bottom: 75px;
        right: 107px;
        cursor: pointer;
      }

    }

    .intro_text_center{
      position: absolute;
      width: 295px;
      /* border: 1px solid black; */
      top: 50px;
      left: 475px;
      font-size: 30px;
      line-height: 30px;
      line-height: 43px;
      font-weight: bold;
    }

    .intro_text_center_side{
      position: absolute;
      width: 295px;
      top: 255px;
      left: 475px;
      color: #888;
      font-size: 14px;
    }

    .intro_text_bottom{
      position: absolute;
      bottom: 38px; left: 50px;
      line-height: 26px;

    }

    strong{
      font-size: 18px;
    }

  }



  .mouse {

    display: flex;


    .animation_mouse {
      position: relative;
      margin-top: 40px;
      margin-left: 520px;
      width: 60px;

      img {
        position: absolute;
        width: 60px;
        height: 60px;
        top: 0;
        left: 0;
        animation: rotate_mouse 1s linear infinite;
      }

      @keyframes rotate_mouse {
        0% {
          top: 0;
        }

        100% {
          top: 8px;
        }
      }


      .fas {
        font-size: 30px;
        animation: rotate_fas 1s linear infinite;
        position: absolute;
        position: absolute;
        top: 60px;
        left: 20.5px;
      }


      @keyframes rotate_fas {
        0% {
          top: 60px;
        }

        100% {
          top: 68px;
        }
      }


    }


    p {
      margin-left: 10px;
      margin-top: 65px;
      font-weight: bold;
    }
  }
}


.profile_Page {
  width: 1280px;
  margin: 0 auto;
  margin-top: 300px;



  .whoAmI {
    font-size: 130px;
    text-align: left;
    border-bottom: 1px solid #707070;
  }

  .profile_h3 {
    font-size: 45px;
    text-align: right;
    margin-right: 265px;
    margin-top: 30px;
  }

  .profile_box {
    display: flex;
    justify-content: space-around;
    margin-top: 20px;

    .profile_left {


      .profile_img {
        width: 500px;
        height: 500px;
      }

      .profile_Page_img_text {
        font-size: 14px;
        color: #888;
      }
    }


    .profile_right {

      border-top: 1px solid #707070;

      .profile_list {

        ul {
          margin-top: 20px;
          font-size: 19px;
          li {
            width: 560px;
            margin-bottom: 20px;
            font-weight: bold;
          }


        }






      }

    }

  }

  .profile_box2 {
    display: flex;
    margin-top: 135px;


    .profile_left2 {
      border-right: 1px solid #707070;
      width: 570px;
      padding-right: 70px;

      h2 {
        font-size: 40px;
        border-bottom: 1px solid #707070;
        padding-bottom: 30px;
        text-align: center;
      }

      .strong_box {
        margin-left: 30px;
        position: relative;
        margin-top: 5px;
        margin-bottom: 20px;

        /*         {
          font-size: 120px;
        } */

        @function makelongshadow($color) {
          $val: 0px 0px $color;

          @for $i from 1 through 10 {
            $val: #{$val},
            -#{$i}px #{$i}px #{$color};
          }

          @return $val;
        }

        .strong_text {
          overflow: hidden;
          margin: 0px auto;
          padding-top: 49px;
          padding-left: 5px;
          height: 110px;
          font-weight: 600;
          line-height: 60px;
          /* font-size: 16px;  */
          text-align: left;
          font-size: 120px;
          color: #918789;
          font-family: 'Georgia';
          text-shadow: makelongshadow(#3E3E40);

        }

        .strong_text_line {
          position: absolute;
          top: 75px;
          left: 129px;
        }

      }

      .profile_box2_text {
        padding-left: 40px;
        margin-bottom: 20px;
      }

      .profile_box2_text_underLine {
        border-bottom: 1px solid #707070;
        padding-bottom: 40px;
      }

      .small_news_box {
        position: relative;
        width: 520px;
        height: 178px;
        margin: 0 auto;
        margin-left: 25px;
        margin-top: 45px;

        .small_news {
          display: block;
          width: 520px;
          height: 178px;

        }

        .target {
          display: block;
          width: 100%;
        }

        /* 돋보기 */
        .magnifier {
          width: 100px;
          height: 100px;
          position: absolute;
          border-radius: 100%;
          box-shadow: 0 0 0 3px rgba(255, 255, 255, 0.85), 0 0 3px 3px rgba(0, 0, 0, 0.25);
          display: none;
        }

      }

    }


    .profile_right2 {
      margin-top: -63px;

      width: 570px;
      padding-left: 70px;

      h2 {
        font-size: 40px;
        margin-left: 23px;
      }

      /*       .imgTv {
        margin-top: 35px;
        width: 500px;
        height: 500px;
        margin-bottom: 20px;
      } */

      .profile_swiper {
        margin-top: 35px;
        width: 500px;
        height: 500px;
        margin-bottom: 20px;

        .swiper-slide {
          display: flex;
          justify-content: center;
          align-items: center;
          font-size: 24px;
          font-weight: bold;
          color: white;
          border-radius: 10px;
          img{
            width: 500px; 
            height: 500px;
          }
        }


      }

      .profile_tv_text{
        margin-left: 40px;
      }
    }


  }

}

.skill_page {
  width: 1280px;
  margin: 0 auto;
  margin-top: 150px;

  .skill_page_h2 {
    width: 100%;
    height: 100px;
    background-color: rgba(0, 0, 0, 70%);
    color: white;
    font-size: 40px;
    line-height: 100px;
    text-align: center;
    /* transition: 0.3s; */

  }

  h3 {
    font-size: 25px;
    margin-top: 30px;
    margin-bottom: 20px;
    text-align: center;
  }

  .skill_page_box {

    display: flex;
    justify-content: space-between;
    margin-top: 20px;
    margin-bottom: 220px;

    .skill_page_left {
      position: relative;
      width: 640px;

      img {
        width: 80px;
        height: 80px;
      }



    }

    .skill_page_left::before {
      content: '';
      display: block;
      position: absolute;
      width: 1px;
      height: 515px;
      background-color: #707070;
      top: 32px;
      right: 0px;
    }

    .skill_page_right {
      width: 600px;
      margin-left: 20px;

      img {
        width: 80px;
        height: 80px;
      }

    }

  }


  .progres_chart {
    width: 620px;
    display: flex;
    margin-right: 0;
    margin-bottom: 20px;

    p {
      width: 100px;
      line-height: 40px;
      margin-right: 20px;
      margin-bottom: 5px;
      color: #abaaaa;
    }

    .progress-bar {
      width: 70%;
      height: 30px;
      background-color: #d5d2d2;
      font-weight: 600;
      font-size: 30px;
      margin-top: 28px;
      margin-left: 23px;



      .progress {
        // 나타내고자 하는 퍼센트 값을 넣으면 됩니다.
        height: 30px;
        padding: 0;
        text-align: center;
        background-color: #002053;
        color: #111;
        transition: 1.3s;
        width: 0%;
      }

      .progress1 {
        width: 90%;
        background-color: #f7670e;
      }

      .progress2 {
        width: 90%;
        background-color: #0848cb;
      }

      .progress3 {
        width: 70%;
        background-color: #ebd930;
      }

      .progress4 {
        width: 40%;
        background-color: #0cbfef;
      }

      .progress5 {
        width: 60%;
        background-color: #662fdb;
      }

      .progress6 {
        width: 70%;
        background-color: #ed76db;
      }
    }

    .num {
      margin-left: 15px;
      width: 30px;
      line-height: 30px;
      margin-top: 28px;
      color: black;
      font-weight: bold;
    }

  }

  .js {
    padding-bottom: 30px;
    border-bottom: 1px solid #707070;
    margin-bottom: 0;
  }

  .scss {
    border-bottom: 1px solid #707070;
    padding-bottom: 30px;
    margin-bottom: 0;
  }

  .Etc {

    h3 {}

    .etc_box {
      display: flex;
      /* margin-left: 20px; */
      justify-content: space-evenly;
      margin: 0 auto;
    }

    div {
      margin-top: 30px;

      p {
        margin-top: 20px;
        text-align: center;
      }
    }

  }
}


.news_page {

  position: relative;

  .news_page_top {
    z-index: 1;

    .main_news_list {

      width: 1280px;
      margin: 0 auto;
      position: relative;

      .main_news_box {

        position: absolute;
        z-index: 5;
        top: -3px;
        left: 300px;

        /* margin-left: 100px; */

        .main_news {}

      }
    }


    .sub_news_list {
      margin: 0 auto;

      display: flex;
      filter: blur(5px);

      .sub_news_box1 {

        .sub_news_1 {
          max-width: 100%;
          width: 1000px;
          height: 1050px;
        }
      }


      .sub_news_box2 {

        .sub_news_2 {
          max-width: 100%;
          width: 1000px;
          height: 1050px;
        }
      }

    }
  }


  .news_page_bottom {
    /* display: block; */
    width: 1280px;
    margin: 0 auto;
    position: fixed;
    top: -150px;
    left: 50%;
    opacity: 0;
    height: 100vh;
    display: flex;
    justify-content: space-around;
    align-items: center;
    display: grid;
    transform: translateX(-50%);



    .hidden {


      .hidden_btn {
        /* color: white; */
        cursor: pointer;
        /* margin-top: -70px; */
        margin-bottom: 120px;
        margin-left: 20px;

      }

      .star {
        position: absolute;
        width: 5px;
        height: 5px;
        border-radius: 50%;
        background-color: #fff088;
        filter: blur(0.5px);
        animation: twinkle 2s linear infinite alternate;
      }

      @keyframes twinkle {
        from {
          opacity: 0;
        }

        to {
          opacity: 1;
        }
      }

      .autotext {
        color: white;

      }

      @keyframes anime_textup {
        0% {
          top: 0;
        }

        20% {
          top: -0.2rem;
        }

        40% {
          top: 0
        }

        60% {
          top: 0
        }

        80% {
          top: 0
        }

        100% {
          top: 0
        }
      }

      span {

        position: relative;
        animation: anime_textup 1.5s infinite;
      }

      span:nth-of-type(1) {
        animation-delay: .1s;
      }

      span:nth-of-type(2) {
        animation-delay: .2s;
      }

      span:nth-of-type(3) {
        animation-delay: .3s;
      }

      span:nth-of-type(4) {
        animation-delay: .4s;
      }

      span:nth-of-type(5) {
        animation-delay: .5s;
      }

      span:nth-of-type(6) {
        animation-delay: .6s;
      }

      span:nth-of-type(7) {
        animation-delay: .7s;
      }

      span:nth-of-type(8) {
        animation-delay: .8s;
      }

      span:nth-of-type(9) {
        animation-delay: .9s;
      }

      span:nth-of-type(10) {
        animation-delay: 1s;
      }

      span:nth-of-type(11) {
        animation-delay: 1.1s;
      }

      span:nth-of-type(12) {
        animation-delay: 1.2s;
      }

      span:nth-of-type(13) {
        animation-delay: 1.3s;
      }

      span:nth-of-type(14) {
        animation-delay: 1.4s;
      }

      span:nth-of-type(15) {
        animation-delay: 1.5s;
      }


    }


  }


  .project_Page {
    opacity: 0;
    width: 100%;
    position: absolute;
    top: 0;
    left: 0;
    display: none;
    background-color: #E6E2DD;
    height: 2288px;
    z-index: 0;
    filter: blur(0px);


    .project_page_container {
      position: relative;
      width: 1280px;
      margin: 0 auto;
      margin-top: 100px;
      /*  overflow: hidden; */

      .project_page_h2 {
        width: 100%;
        height: 100px;
        background-color: rgba(0, 0, 0, 70%);
        color: white;
        font-size: 40px;
